function FilterBar() {
  return (
    <div className="filter-bar">
      <select><option>Tất cả danh mục</option></select>
      <select><option>Trạng thái</option></select>
      <input type="number" placeholder="Từ (đ)" />
      <input type="number" placeholder="Đến (đ)" />
      <input type="text" placeholder="Tìm tên sản phẩm" />
      <button>Lọc</button>
      <button className="clear">Xóa bộ lọc</button>
    </div>
  );
}
export default FilterBar;
